      SELECT DISTINCT CASE + - 66 WHEN + COUNT ( * ) THEN + 48 * COALESCE ( + - 13, - CAST ( 47 AS INTEGER ), - - 70 + - - ( + COUNT ( * ) ) / + 25 ) WHEN - 64 THEN NULL END AS col0, 76 AS col1;

outputs:
  - name: q9950.out
    data: |
      NULL	76
